import "./Styles/browse_recipes.css"

function BrowseRecipes(){

    return (
      <div className="browse_recipes_image_container">

        <img className="browse_recipes_image"  src={require("./Placeholder_Images/food1.jpeg")}></img>

        <img className="browse_recipes_image" src={require("./Placeholder_Images/food2.jpeg")}></img>

        <img className="browse_recipes_image" src={require("./Placeholder_Images/food3.jpeg")}></img>

      </div>
    );
}

export default BrowseRecipes;
